const cartReducer = (state, action) => {
  if (action.type === "ADD_TO_CART") {
    let { itemname, description, image } = action.payload;

    let cartProduct;

    cartProduct = {
      itemname,
      description,
      image,
    };

    console.log(cartProduct);

    return {
      // ...state,
      cart: ["a", "b"],
    };
  }
  return state;
};

export default cartReducer;
